import type { MultipleChoice } from "./MultipleChoice";
import type { ShortAnswer } from "./ShortAnswer";
import type { Tracing } from "./Tracing";
export type Question = {
    "type": "ShortAnswer";
} & ShortAnswer | {
    "type": "Tracing";
} & Tracing | {
    "type": "MultipleChoice";
} & MultipleChoice;
